import { useDispatch, useSelector } from "react-redux";
import { Redirect, useHistory } from 'react-router-dom'
import React from 'react';
import { NavLink } from 'react-router-dom';
import LogoutButton from './auth/LogoutButton';
import LoginFormModal from "./LoginFormModal";
import SignUpFormModal from "./SignupFormModal";
import CreateQuestionFormModal from "./CreateQuestionForm/CreateQuestionModal";
import ProfileButton from "./ProfileButton/profileButon";
import { login } from "../store/session";
import './NavBar.css'


const NavBar = () => {
  const dispatch = useDispatch()
  const history = useHistory()
  const sessionUser = useSelector(state => state.session.user)
  const demoUser = () => {
    const obj = {
      'email': 'demo@aa.io',
      'password': 'password'
    }
    dispatch(login(obj.email, obj.password))
  }

  let userLinks;
  if (sessionUser) {
    userLinks = (
      <div className="userlinks2">
        <div>
          <div ClassName='myycontent'>
            <a href='/your-questions' exact={true}>
              My Contents
            </a>
          </div>
        </div>
        <div className="addquestion">
          <CreateQuestionFormModal />
        </div>
        <div className="profileimg"><ProfileButton /></div>
      </div>
    )
  } else {
    userLinks = (
      <>
        <div>
          <LoginFormModal />
        </div>
        <div>
          <SignUpFormModal />
        </div>
        <button onClick={demoUser}>
          Demo User
        </button>
      </>
    )
  }
  return (
    <nav className="navhead">
      <div className="navwrapper">
        <div>


          <div onClick={(e) => history.push('/')} ClassName='fglogotext'>
            <div className='fq'> Fourth Quorra</div>
          </div>
          <div className="userlinks">
            {userLinks}
          </div>
        </div>
      </div>
    </nav>
  );
}

export default NavBar;
